('ceddyornot', 'So which one do you like Zus Buttercrme latte or Gigis', 55, '2023-06-01 05:20:00', 136, 52400, 59, 2373, '[]'),
('ceddyornot', 'We meet again for the 3rd episode of MILO GAMESHOW EDISI RAYA Untuk episode ketiga ni kita ada special guest yang rasanya memang ramai fans Siapa lagi kalau bukan LuckyBoy   yes this is amelia    Ceddy nak korang tengok dan judge macam mana diorang buat smoothie okay hahaha Lepas tengok jangan lupa share dan like ya sayangsss  JomMinumMILO MILOGameshow EdisiRaya', 338, '2023-05-31 13:10:32', 26, 81200, 26, 1441, '[\'jomminummilo\', \'milogameshow\', \'edisiraya\']'),
('ceddyornot', 'The Loaf Muslim Friendly just opened its first branch in PENANG on Penang Hill and I got to try out their food for the first time too Check out what they have MakanLokal ', 91, '2023-05-30 11:20:10', 31, 62800, 50, 1212, '[\'makanlokal\']'),
('ceddyornot', 'Yet another Hokkien content since I am back in Penang This time I am trying out Hock Seng Rojak Muslim followers takyah try lah ya I cannot guarantee the halalness  since Ive never tried before my whole life The price is OK The large bowl is RM11 The service is good too Worth the queue or not For me yes lah But dont worry not like every day is like this lah Lady boss said on weekdays its quiet', 58, '2023-05-27 12:22:29', 109, 92500, 315, 3775, '[]'),
('ceddyornot', 'Hello sayangs The 2nd episode of JOM MINUM MILO GAMESHOW EDISI RAYA is out Kalini kita ada celebrity couple Nabil Mahir  dan Ayda Jebat  untuk join smoothie challenge kita And kita ada special appearance sebagai judge nak tahu siapa kena tengok sampai habis tau Jangan lupa like  share ya lepas tengok  JomMinumMILO MILOGameshow EdisiRaya', 533, '2023-05-26 12:13:09', 4, 97700, 7, 470, '[\'jomminummilo\', \'milogameshow\', \'edisiraya\']'),
('ceddyornot', 'QBox Cafe  UOA Business Park Tower 3 When they invited me over I macam Eh in an office area But then again if food is good why not kan  The price is around RM16 per bowl and the portion is huge Plus they also open on Saturdays so its even better sebab no need to fight with office people hahaha MakanLokal ', 109, '2023-05-25 11:45:39', 15, 66600, 26, 914, '[\'makanlokal\']'),
