('ceddyornot', 'Get ready to ride the Syok Wave with Mister Potatos crinkle cut chips Mix and match their bold flavors like Seafood Fiery Fried Chicken and BBQ for a ridiculous taste experience  MisterPotato KerangupanBergandaRidiculouslyTasty RidiculousMix  misterpotatomy ', 64, '2023-05-23 12:25:21', 16, 17200, 4, 2377, '[\'misterpotato\', \'kerangupanberganda\', \'ridiculouslytasty\', \'ridiculousmix\']'),
('ceddyornot', ' Sushi Mastro Nikkei  Kepong Muslim owned This is my SECOND time going there and sure enough the food is still as good Because of them I got to try UNI sea urchin for the very first time Yes boleh makan raw or like how they mix in their udon There are other dishes too lah enjoy the video ok MakanLokal Sushi Mastro Nikkei ', 127, '2023-05-22 12:02:47', 46, 40800, 94, 2125, '[\'makanlokal\']'),
('ceddyornot', 'Din Tai Fung  ada   DIN by Din Tai Fung  NO  Basically it was OK lah for me not something to shout about they dont have many choices of dim sum I would say if you want to try Chinese food but PORKFREE Eh I tak cakap halal sebab I dont think they have halal cert can try this one lah Those who tried the food here which one is your favorite dish makanlokal ', 85, '2023-05-21 09:57:51', 37, 67100, 24, 1998, '[\'makanlokal\']'),
('ceddyornot', 'Hello guys welcome to the first episode of JOM MINUM MILO GAMESHOW EDISI RAYA  Untuk episod yang pertama ni kita ada Amir Masdi  dan Rabbit Mac  untuk join BLIND TEST CHALLENGE  Nak tengok diorang power ke tak power teka resepi MILO Jom tengok video ni jangan lupa like dan share ya  JomMinumMILO MILOGameshow EdisiRaya', 388, '2023-05-19 11:03:58', 16, 75800, 16, 1020, '[\'jomminummilo\', \'milogameshow\', \'edisiraya\']'),
