('adikfoods', 'Tips nak Sambal Nor bertambah sedap Makan dengan petai kacang botor ulam berdaun macam pegaga ulam raja selum ada pulak ikan goreng jika ada ikan masin belanak goreng lagi la sedap makan tak hengat dunia Moh le buat ada pelbagai versi Cara saya yang simple ikut cara arwah Mak Kalau kome suka letak gula atau serbuk perasa letaklah ok je cuma saya memang tak letak Sesiapa yang tak tahan pedas guna cabai merah besor tu  Kuali yang saya guna dari tefalmy  Kredit lagu Madu Tiga   Bahanbahan Sambal Nyor Cabai merah  cabai burung ikut selera Seinci belacan bakar  sdk garam adjust Segenggam ikan bilis  rendam dan bilas 2 cwn kelapa parut putih Jus limau nipis secukup rasa 23 sdb santan pekat Bahan Sampingan ikut citarasa Ulamulaman Ikan goreng Ikan masin Telur masin  FoodFestOnTikTok makanlokal fyp foryou foryourpage foryoupage adikfoodsrecipe masak resepisimple makan cooking sedap enak ', 59, '2023-06-14 11:45:11', 28, 22800, 192, 847, '[\'foodfestontiktok\', \'makanlokal\', \'fyp\', \'foryou\', \'foryourpage\', \'foryoupage\', \'adikfoodsrecipe\', \'masak\', \'resepisimple\', \'makan\', \'cooking\', \'sedap\', \'enak\']'),
