('adikfoods', 'FoodFestOnTikTok  Setelah sebulan lebih menggunakan Tefal Ingenio ni memang best dan menyeronokkan Bukan sahaja mudah dengan Tefal Ingenio ni One Handle Wonder yang boleh dibuka kita hanya Click  Clip dah boleh angkat dan  masak di atas dapur masuk oven malahan boleh terus dihidangkan Moh le cuba  Dapatkan Produk Tefal Ingenio pada harga Diskaun 10  Guna Code  ADIKXINGENIO  Bermula dari 1 Jun sampai 31 Julai 2023  SwitchToIngenio IngeniouslyTefal OneHandleWonder SimplifyYourCooking   Bahanbahan Ikan Bakar 1 kg ikan Talapia  Siakap dan lainlain Garam Kunyit Daun pisang Kuah Sepuh Bahan hirisan 9 biji bawang merah kecil 9 biji cili padi 1 biji cili merah Segenggam daun kesum Bahan perasa 1 in belacan 2 cwn Santan segar Sedikit asam jawa 12 sdb kerisik Garamgula secukup rasa Perahan limau nipis secukup rasa adikfoods adikfoodsrecipe tiktokmalaysia tiktokmy fyp foryou foryoupage foryourpage fish recipe makanlokal ', 59, '2023-06-10 11:55:43', 28, 18800, 190, 814, '[\'foodfestontiktok\', \'switchtoingenio\', \'ingeniouslytefal\', \'onehandlewonder\', \'simplifyyourcooking\', \'adikfoods\', \'adikfoodsrecipe\', \'tiktokmalaysia\', \'tiktokmy\', \'fyp\', \'foryou\', \'foryoupage\', \'foryourpage\', \'fish\', \'recipe\', \'makanlokal\']'),
('adikfoods', 'Taraaaaa Adiks Enoki Chicken  Bouquet with Watermelon Salad Inilah hasil menu yang saya buat menggunakan bahanbahan dari Lotuss Mystery Box untuk Minggu Pertama Apabila kita dapat bahanbahan daripada Lotuss  yang segar berkualiti dan pada harga berpatutan pulak tu memanglah otak pun segar dan macammacam menu kita boleh fikir dan hasilkan Lotuss peneman terbaik kita untuk memasak di dapur Moh le kita support barangbarang hasil buatan Malaysia  Kome boleh join  Contest Lotuss Lejen Dapur Mystery Box ini juga Tapi Lotuss tak lah hantar Mystery Box kepada kome ia akan update setiap dua minggu sekali bahanbahan dalam Mystery Box di media sosial mereka Kome hanya kena  Beli sekurangkurangnya 3 bahan tersebut dari Lotuss  Create menu mengikut kreativiti anda sendiri  Ambil gambar dan post di IG anda  Tulis caption berkaitan menu  resepi anda  tag  Lotuss Malaysia dan hashtag LejenDapurLotuss  Bahan bahan  Enoki Chicken Bouquet 2 paket cendawan Enoki Kuah Kacang  untuk dimakan sebagai sos Kisar semua bahan guna chopper Isi dada ayam  boleh campur bahagian peha 1 biji bawang besar 3 ulas bawang putih 1 batang daun bawang 1 biji cili merah  buang biji 1 biji cili padi jika suka letak lebih 1 sdb gula 1 sdk serbuk lada putih 2 sdb kicap cair  cwn tepung jagung 1 biji telur Garam secukup rasa   Watermelon Salad  biji tembikai  potong dadu 1 biji timun  buang empulur  potong dadu 1 biji bawang besr  potong dadu Segenggam daun pudina 1 sdb gula adjust 2 sdb pati oren  saya guna Sunquick Perahan jus limau secukup rasa Garam secukup rasa  lotussmalaysia lejendapurlotuss  adikfoods adikfoodsrecipe tiktokmalaysia tiktokmy FoodFestOnTikTok  MakanLokal fyp foryou foryoupage foryourpage  homecooking  breakfast dinner lunch cooking recipe creativity homemade mushroom chicken salad fruits', 89, '2023-06-08 11:14:35', 16, 21600, 52, 1090, '[\'lejendapurlotuss\', \'lotussmalaysia\', \'lejendapurlotuss\', \'adikfoods\', \'adikfoodsrecipe\', \'tiktokmalaysia\', \'tiktokmy\', \'foodfestontiktok\', \'makanlokal\', \'fyp\', \'foryou\', \'foryoupage\', \'foryourpage\', \'homecooking\', \'breakfast\', \'dinner\', \'lunch\', \'cooking\', \'recipe\', \'creativity\', \'homemade\', \'mushroom\', \'chicken\', \'salad\', \'fruits\']'),
('adikfoods', 'FoodFestOnTikTok  Kome pastikan Stay Tuned untuk videovideo saya menyahut cabaran Lejen Dapur yang dikendalikan oleh Lotuss Malaysia   Saya akan diberi 3 buah Mystery Box dimana saya dikehendaki memasak  menggunakan minimum 4 bahan yang ada dalam setiap Mystery Box tersebut  Ada 3 Mystery Box maka akan ada 3 video masakan Nak tengok saya berjaya menggunakan bahanbahan masakan yang segar dari Lotus Malaysia dalam LejenDapur atau tidak kenalah tunggu videovideo tersebut Paling menarik kome pun boleh menggunakan bahanbahan Mystery Box yang sama di mana semasa tu dah tak misteri lagi le tak aci tau  recreate recipe kome sendiri dan join contest Boleh menang hadiah menarik Apa hadiahnya Tunggu maklumatnya dalam posting video  akan datang  adikfoods adikfoodsrecipe lotussmalaysia LejenDapur  tiktokmalaysia tiktokmy MakanLokal pasta spaghetti fyp foryou foryoupage foryourpage yummy cooking recipe aglioeolio ', 89, '2023-06-06 11:49:50', 83, 59000, 224, 2507, '[\'foodfestontiktok\', \'lejendapur\', \'adikfoods\', \'adikfoodsrecipe\', \'lotussmalaysia\', \'lejendapur\', \'tiktokmalaysia\', \'tiktokmy\', \'makanlokal\', \'pasta\', \'spaghetti\', \'fyp\', \'foryou\', \'foryoupage\', \'foryourpage\', \'yummy\', \'cooking\', \'recipe\', \'aglioeolio\']'),
