('jwquickfood', 'To all grape lovers Yes you can eat grapes every day Its packed with lots of nutrients premium Australian table grapes from GROWN IN GOOD NATURE is my all time favorite It has 3 types of grapes Sweet Globe Distinctively crisp sweet and refreshing in flavour Candy Snaps Taste is intense and sweet while the texture is firm but juicy Sweet Sapphire  Naturally large with an elongated tubular shape this variant is sweet in taste and crisp in texture Which one is your fav   grape australiangrape healthy healthylife nutrition ', 24, '2023-03-23 11:47:23', 1, 2259, 1, 126, '[\'grape\', \'australiangrape\', \'healthy\', \'healthylife\', \'nutrition\']'),
('jwquickfood', '15mins meal  Shakshuka My fav healthy meal I made this in less that 15mins its so easy and so yummm Pair this with air fried baguette is da best  Using ROCKURWOK ceramic non stick frying pan in this recipe this pan has no ptfe pfoa pfas The metal handles are solid and sturdy can be used in oven and dishwasher  Purchase link httpswwwamazoncomdpB09X2LPYJPrefmyititledp Ingredients 12 onion diced  2 garlic cloves finely chopped 12 greenred bell pepper seeded and diced  1 tomato  2tbsp tomato sauce  2 eggs  White button  Salt Black pepper  Cilantroparsley leaves  Any bread of your choice  Steps 1 Heat a bit of oil in a skillet then add onion garlic bell pepper white button and cook until soft  2 Add tomato tomato sauce salt and pepper bring the sauce to a simmer until thicken 3 When everything is soften and mixed well use a spoon to make 2 wells in the sauce and crack 2 eggs into each wells cover lid then cook over low heat for 5mins  4 Garnish with chopped cilantro or parsley and black pepper and youre done Enjoy Dont forget to tag me if you try ya   shakshuka easyrecipe easymeal healthyrecipe healthy ', 19, '2023-03-16 12:15:51', 1, 2238, 0, 130, '[\'shakshuka\', \'easyrecipe\', \'easymeal\', \'healthyrecipe\', \'healthy\']'),
('jwquickfood', 'Easy comfort meal Im using Honcook ceramic pot in this recipe Its coated with natural ceramic rock coating with no ptfe pfoa and pfas And the most importantly its so pretty and ultra light love it so much  Purchase link httpspageslazadacommywowgcpmystorelpvouchersellerIdvrb7n7rlbnevoucherIdveeybw9k44yn2rscenestoredomainSHOP  Now we back to our recipe Ingredients Siew mai  Dumpling Hard boiled egg Porridge  Chicken cubes  White carrot  Mushroom Lettuce  Rice  Pinch of salt Black pepper A bit of oil Steps 1 Pan fry chicken and mushroom 2 Add uncooked rice and water into pot stir occasionally  3 Add white carrot after 20mins stir 4 Add lettuce after 25mins stir 5 Add seasoning cook for another 5mins and were done Enjoy Dont forget to tag me if you try ya   HoncookMY HoncookCeramicSoupPot ceramicpot lazada shopee easyrecipe porridge', 18, '2023-03-01 11:44:39', 2, 2030, 0, 62, '[\'honcookmy\', \'honcookceramicsouppot\', \'ceramicpot\', \'lazada\', \'shopee\', \'easyrecipe\', \'porridge\']'),
('jwquickfood', 'One of my favorite CNY snacks  It is not only so easy to prepare but it is incredibly healthy as well Heres what you need Ingredients Red dates Walnuts Honey White sesame Directions 1 Mix walnut with honey and white sesame 2 Remove seeds from red dates and cut 3 Stuff walnut into red date 4 Air fry on 120C 8 mins and were done Looking for a companion to guide you in enhancing your health this new year Check out the Pulse by Prudential Malaysia app to receive personalized tips based on your fitness goals   CNYFood CNYBazaar2023 CNY healthyrecipe airfryer ', 17, '2023-01-26 01:00:17', 10, 14700, 16, 492, '[\'cnyfood\', \'cnybazaar2023\', \'cny\', \'healthyrecipe\', \'airfryer\']'),
('jwquickfood', 'Poke bowl Easy refreshing meal always my fav meal after few days of outside food you can use this secret sauce in every mealsalad  Ingredients Noodles  Poached egg Avocado  Fungus  Shrimps Zucchini  Pomelo  Black pepper  Sauce 1tbsp oyster sauce  1tbsp soy sauceuse Japanese soy sauce would be better if you got 1tsp honey  Enjoy Dont forget to tag me if you try ya   CNYFood CNYBazaar2023 pokebowl easyrecipes healthyfood', 15, '2023-01-25 03:58:55', 1, 6103, 0, 194, '[\'cnyfood\', \'cnybazaar2023\', \'pokebowl\', \'easyrecipes\', \'healthyfood\']'),
('jwquickfood', '5mins berries yogurt cup Make this cup for your family members during CNY Ingredients Berry jam Yogurt Strawberry  Cookie Marshmallow  CNY sweets Recipe 1 Add berry jam into a glass 2 Mix berry jam and yogurt then add into glass  3 Add strawberry slices and plain yogurt into glass  4 Top with strawberry marshmallow cny sweets cookie and were done Enjoy Dont forget to tag me if you try ya   cny cnyrecipe yogurt yogurtcup CNYFood CNYBazaar2023 ', 13, '2023-01-24 11:28:28', 1, 2120, 0, 97, '[\'cny\', \'cnyrecipe\', \'yogurt\', \'yogurtcup\', \'cnyfood\', \'cnybazaar2023\']'),
